import React from 'react';
import {Fragment} from 'react';
import './Footer.css'

function Footer() {
    return (
        <Fragment>
            <footer>
            <h1> this is the footer </h1>
            <p>There is some test here</p>
            </footer>
        </Fragment>
    )
}
export default Footer;
